        public static DataCollection GenerateCollection()
        {
            var collection = new DataCollection();
            foreach (var data in Tgdb.Data)
            {
                var versionStart = data.Key.LastIndexOf("(") + 1;
                var versionEnd = data.Key.LastIndexOf(")");

                var group = new DataGroup
                {

                    Header = new DatHeader()
                    {
                        Name = data.Key.Substring(0, data.Key.LastIndexOf("(")).Trim(),
                        Version = data.Key.Substring(versionStart, versionEnd - versionStart)
                    }
                };
                collection.Groups.Add(group);

                foreach (var game in data.Value)
                {
                    group.Games.Add(new DataGame()
                    {
                        Name = game.Value.Name.Substring(0, game.Value.Name.LastIndexOf(".")),
                        Description = game.Value.Name.Substring(0, game.Value.Name.LastIndexOf(".")),
                        Roms = new List<DatRom>()
                        {
                            new DatRom()
                            {
                                Crc32 = game.Key.ToString("X8"),
                                Name = game.Value.Name
                            }
                        },
                        TgdbId = new List<int>(game.Value.TgdbId)
                    });
                }
            }

            return collection;
        }
    }
